import moment from "moment";
import { weekdayArray } from "../constant/constants.js";
import { CalendarContainer, CalendarWeekContainer, CalendarDayContainer } from "../styledComponent/style.js";

function MyCalendar() {
    const year = 2022;
    const month = 5;

    const startOfMonth = moment().year(year).month(month).startOf("month").format("e");
    const endOfMonth = moment().year(year).month(month).endOf("month").format("e");

    return (
        <CalendarContainer>
            <CalendarWeekContainer>
                {weekdayArray.map((weekday, idx) => {
                    <CalendarDayContainer key={idx}>{weekday}</CalendarDayContainer>;
                })}
                <CalendarDayContainer>1</CalendarDayContainer>
            </CalendarWeekContainer>
        </CalendarContainer>
    );
}

export default MyCalendar;
